DROP TABLE IF EXISTS paf_countries;
CREATE TABLE paf_countries (
  id varchar(100) NOT NULL,
  name varchar(100) NOT NULL,
  iso3 char(3) DEFAULT NULL,
  numeric_code char(3) DEFAULT NULL,
  iso2 char(2) DEFAULT NULL,
  phonecode varchar(255) DEFAULT NULL,
  capital varchar(255) DEFAULT NULL,
  currency varchar(255) DEFAULT NULL,
  currency_name varchar(255) DEFAULT NULL,
  currency_symbol varchar(255) DEFAULT NULL,
  tld varchar(255) DEFAULT NULL,
  native varchar(255) DEFAULT NULL,
  region varchar(255) DEFAULT NULL,
  subregion varchar(255) DEFAULT NULL,
  timezones jsonb,
  translations jsonb,
  latitude decimal(10,8) DEFAULT NULL,
  longitude decimal(11,8) DEFAULT NULL,
  emoji varchar(191) DEFAULT NULL,
  emoji_unicode varchar(191) DEFAULT NULL,
  created_at timestamp NULL DEFAULT NULL,
  updated_at timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  flag smallint NOT NULL DEFAULT 1,
  wiki_data_id varchar(255) DEFAULT NULL
);

ALTER TABLE paf_countries ADD PRIMARY KEY (numeric_code);

ALTER TABLE paf_countries ADD UNIQUE (iso3);
ALTER TABLE paf_countries ADD UNIQUE (iso2);

CREATE INDEX idx_paf_countries_name ON paf_countries (name);
CREATE INDEX idx_paf_countries_phonecode ON paf_countries (phonecode);

